import { connect } from 'react-redux';
import {Text, View, Image } from 'react-native';
import * as selectors from '../../reducers'
import React from 'react';
import styles from './styles'
import { URL } from '../../../configuration'
import { Actions } from 'react-native-router-flux';
import { LinearGradient } from 'expo-linear-gradient';
import { colors } from '../../../configuration';

const Home = () => (
  <View style={styles.container}>
        <View style={styles.row}>
            <Image style={styles.logo} source={require('../../public/static/img/logo.png')} ></Image>
            <Text style={styles.text} >{"VOTARK  "}</Text>
        </View>
        <TouchableHighlight onPress={() => this.moveToAddNewCustomer()}>
            <Image style={styles.imagestyle} source={require('./ic_action_name.png')} />
        </TouchableHighlight>
</View>
);

export default connect(
  state => ({
    isAuthenticated: selectors.isAuthenticated(state),
  }),
  undefined,
  (stateToProps,disptachToProps) => {
    if(stateToProps.isAuthenticated){
      if(typeof document !== 'undefined'){
        window.location.href = URL+'login/'
      }
      else{
        Actions.Login(true)
      }
    }
    return ({isAuthenticated: stateToProps.isAuthenticated})
  }
)(Home);
